import React from "react";
import Logo from "../assets/logo.png";

const Navbar = () => {
  return (
    <div className="w-screen h-16 fixed z-50 flex justify-between items-center px-16 bg-white">
      <div className="w-full"></div>
      <img className="h-12" src={Logo} alt="logo" />
      <div className="flex flex-row w-full justify-end items-center  space-x-4">
        <div className="hidden lg:block">
          <div className=" flex flex-row space-x-2">
            <p className="font-bold">Credits</p>
            <p>2000</p>
          </div>
        </div>
        <div className="hidden lg:block">Buy Credits</div>
      </div>
    </div>
  );
};

export default Navbar;
